	 (1,'content-sistema-coordenadas-rectangulares','content-sistema-coordenadas-rectangulares','<p style="text-align: justify; ">Coordenadas cartesianas es el nombre que se da al sistema para localizar un punto en el espacio. Si queremos localizar algo en un plano necesitamos:</p><p style="text-align: justify; "><b>Una medida horizontal</b>: izquierda-derecha. A la que llamamos X.</p><p style="text-align: justify; "><b>Una medida vertical</b>: arriba-abajo. A la que llamamos Y.</p><p style="text-align: justify; "><b>Un punto de referencia desde el que empezar a medir</b>: el origen. Lo llamamos origen de coordenadas, O.<br></p><p style="text-align: justify; "><b>Coordenadas</b>: Punto de referencia para empezar a medir</p><p style="text-align: justify; ">Llamamos origen de coordenadas al punto O, donde está el planeta verde en la imagen, porque es el punto del que parten las líneas que marcan los dos ejes de coordenadas.<br></p><p><br></p><p style="text-align: center; "><img src="data:image/png;base64," data-filename="1.png" style="width: 222px;"></p><p style="text-align: center; "><br></p><p style="text-align: center; "><img src="data:image/png;base64," data-filename="2.png" style="width: 222px;"></p><p style="text-align: center; "><br></p><p style="text-align: center; "><img src="data:image/png;base64," data-filename="3.png" style="width: 434px;"></p><p><br></p><p><b>Ejemplo</b></p><p><br></p><p style="text-align: justify; ">Reciclar es importante. Cerca de tu casa seguro hay lugares que reciben tus deshechos para reciclarlos, ubica la dirección y recomiéndala a tus vecinos. En un plano cartesiano siempre señalamos la ubicación en el eje de las X seguida por la ubicación en el eje de las Y. Aprendamos con el siguiente ejemplo: observa que el gráfico de la derecha la recicladora de papel está entre la calle A y la avenida W esto sería el par ordenado (A;W) , la recicladora de vidrio está entre la calle B y la avenida X esta ubicación sería el par ordenado (B;W) y la reciladora de plástico está entre la calle C y la avenida Y está sería el par ordenado (C;Y).</p><p><br></p><p style="text-align: center; "><img src="data:image/png;base64," data-filename="4.png" style="width: 632px;"><br></p><p><br></p>','2021-04-05 18:14:18',NULL,NULL,1,NULL,0),
	 (3,'Números naturales de hasta seis cifras ','Números-naturales-de-hasta-seis-cifras ','<p><span style="color:#800080">En un n&uacute;mero de seis cifras, la primera cifra de la derecha son las unidades, la segunda las decenas, la tercera las centenas, la cuarta las unidades de millar, la quinta las decenas de millar y la sexta las centenas de millar.</span></p>

<p><img alt="" src="data:image/png;base64," style="background-color:rgba(0, 0, 0, 0.075)" /><img alt="" src="data:image/png;base64," style="background-color:rgba(0, 0, 0, 0.075)" /></p>

<p><span style="color:#0000FF"><strong>Sabias que...</strong></span></p>

<p><span style="color:#FF8C00">Un vaso pl&aacute;stico tarda en degradarse 365 000 d&iacute;as, es decir, mil a&ntilde;os; una mu&ntilde;eca de pl&aacute;stico, 109 500 d&iacute;as, lo que es igual a 300 a&ntilde;os; un par de zapatos deportivos, 73 000 d&iacute;as, que equivalen a 200 a&ntilde;os; y una funda de pl&aacute;stico, 54 750 d&iacute;as, es decir, 150 a&ntilde;os. Lamentablemente o ventajosamente no alcanzaremos a ver la desaparici&oacute;n de ninguno de estos art&iacute;culos. Para reforzar lo aprendido, vamos a escribir&nbsp;cada una de las cantidades para aprender a escribir n&uacute;meros naturales de seis cifras.&nbsp;</span></p>

<p><img alt="" src="data:image/png;base64," style="background-color:rgba(0, 0, 0, 0.075)" /></p>

<p>&nbsp;</p>

<p>&nbsp;</p>
','2021-04-05 23:54:19','2021-04-06 02:50:37',NULL,1,1,0),
	 (7,'Valor Posicional','valor-posicional','<p style="text-align:center"><strong>Valor Posicional</strong></p>

<table border="0" cellpadding="0" cellspacing="0" style="width:432px">
	<tbody>
		<tr>
			<td style="height:517px; width:432px">
			<p>En un n&uacute;mero natural, el d&iacute;gito m&aacute;s a la derecha est&aacute; siempre en el lugar de las unidades. El siguiente m&aacute;s a la derecha est&aacute; en el lugar de las decenas. Los d&iacute;gitos restantes contin&uacute;an llenando los valores posicionales hasta que ya no quedan d&iacute;gitos.<br />
			Ejemplo: 459<br />
			El n&uacute;mero 459 esta compuesto de 4 centenas 5 decenas y 9 unidades.<br />
			Tambi&eacute;n podemos escribir esto como:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 459= 400 + 50 +9&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ahora analicemos un ejemplo con una tabla de valor posicional:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; La tabla 2 es una tabla con el valor posicional para 9 digitos, analizo y repaso cada valor posicional o tambien llamado relativo en la tabla</p>

			<p><img alt="" src="data:image/png;base64," /><img alt="" src="data:image/png;base64," /></p>

			<p>&nbsp;</p>
			</td>
		</tr>
	</tbody>
</table>
