	 (10,'Suma de los valores posicionales','Suma de los valores posicionales','<p>Debemos ubicar cada uno de los valores correspondientes en sus posiciones unidades con unidades, decenas con decenas y centenas con centenas para asi poder obtener el resultado correspondiente. Miremos el ejemplo en la imagen y analice la ubicaci&oacute;n de cada uno de las cifras correspondientes</p>

